import React, {useEffect, useState} from "react";
import {IEmployee} from "./models/IEmployee";
import axios from 'axios';
import {NavLink} from "react-router-dom";
interface IProps {}
interface IState {
    employees : IEmployee[];
    errorMessage : string;
}

let Employees:React.FC<IProps> =() =>{
    let [employeeState,setEmployeeState] = useState<IState>({
        employees : []  as IEmployee[],
        errorMessage : ''
    });
    useEffect(()=>{
        let dataURL : string = `https://gist.githubusercontent.com/thenaveensaggam/2c0a106c0b66ef2c8f4eb2b2c8c31e6d/raw/416efcc2300afc13cd0aa6413b2de4918a50ad30/contacts-02-12-2020.json`;
        axios.get(dataURL).then((response) => {
            setEmployeeState({
                ...employeeState,
                employees : response.data
            });
        }).catch((error) => {
            setEmployeeState({
                ...employeeState,
                errorMessage : error.message
            });
        });
    },[]);

    return(
        <React.Fragment>
            <section className="mt-3">
                <div className="container">
                    <div className="row">
                        <div className="col">
                            <p className="h3 text-primary">Employees</p>
                            <p>Lorem ipsum dolor sit amet, consectetur adipisicing elit. Aperiam blanditiis corporis delectus deserunt facere illo incidunt minima nam natus optio porro possimus qui quibusdam quod rem repellat, rerum tenetur voluptas!</p>
                        </div>
                    </div>
                </div>
            </section>
            <section>
                <div className="container">
                    <div className="row">
                        <div className="col">
                            <table className="table table-striped table-hover text-center">
                                <thead className="bg-dark text-primary">
                                <tr>
                                    <th>SNO</th>
                                    <th>NAME</th>
                                    <th>Email</th>
                                    <th>AGE</th>
                                    <th>Location</th>
                                    <th>Phone</th>
                                </tr>
                                </thead>
                                <tbody>
                                {
                                    employees.length > 0 &&
                                    employees.map(employee => {
                                        return (
                                            <tr key={employee.login.uuid}>
                                                <td>{employee.login.uuid.substr(employee.login.uuid.length - 5)}</td>
                                                <td>
                                                    <NavLink to={`/employees/${employee.login.uuid}`} className="text-primary">
                                                        {employee.name.title}. {employee.name.first} {employee.name.last}
                                                    </NavLink>
                                                </td>
                                                <td>{employee.email}</td>
                                                <td>{employee.dob.age} Yrs</td>
                                                <td>{employee.location.city}</td>
                                                <td>{employee.phone}</td>
                                            </tr>
                                        )
                                    })
                                }
                                </tbody>
                            </table>
                        </div>
                    </div>
                </div>
            </section>
        </React.Fragment>
    )
};
export default Employees;
